// client/src/AccountManagement.js
import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';

function AccountManagement() {
  const [accounts, setAccounts] = useState([]);
  const [accountForm, setAccountForm] = useState({ id: null, accountId: '', password: '' });
  const [isEditing, setIsEditing] = useState(false);
  const navigate = useNavigate();

  const fetchAccounts = () => {
    fetch('/api/accounts')
      .then(response => response.json())
      .then(data => setAccounts(data))
      .catch(error => console.error('Error fetching accounts:', error));
  };

  useEffect(() => {
    fetchAccounts();
  }, []);

  const handleSubmit = (e) => {
    e.preventDefault();
    if (isEditing) {
      fetch(`/api/accounts/${accountForm.id}`, {
        method: 'PUT',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({
          accountId: accountForm.accountId,
          password: accountForm.password
        })
      })
        .then(response => response.json())
        .then(updatedAccount => {
          setAccounts(accounts.map(a => a.id === updatedAccount.id ? updatedAccount : a));
          resetForm();
        })
        .catch(error => console.error('Error updating account:', error));
    } else {
      fetch('/api/accounts', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({
          accountId: accountForm.accountId,
          password: accountForm.password
        })
      })
        .then(response => response.json())
        .then(newAccount => {
          setAccounts([...accounts, newAccount]);
          resetForm();
        })
        .catch(error => console.error('Error creating account:', error));
    }
  };

  const handleEdit = (account) => {
    setAccountForm(account);
    setIsEditing(true);
  };

  const handleDelete = (id) => {
    fetch(`/api/accounts/${id}`, { method: 'DELETE' })
      .then(response => response.json())
      .then(deletedAccount => {
        setAccounts(accounts.filter(a => a.id !== deletedAccount.id));
      })
      .catch(error => console.error('Error deleting account:', error));
  };

  const resetForm = () => {
    setAccountForm({ id: null, accountId: '', password: '' });
    setIsEditing(false);
  };

  return (
    <div style={{ padding: '20px' }}>
      <h1>アカウント管理</h1>
      <button onClick={() => navigate('/dashboard')}>ダッシュボードに戻る</button>
      <form onSubmit={handleSubmit}>
        <div>
          <label>アカウントID: </label>
          <input
            type="text"
            value={accountForm.accountId}
            onChange={(e) => setAccountForm({ ...accountForm, accountId: e.target.value })}
            required
          />
        </div>
        <div>
          <label>パスワード: </label>
          <input
            type="password"
            value={accountForm.password}
            onChange={(e) => setAccountForm({ ...accountForm, password: e.target.value })}
            required
          />
        </div>
        <button type="submit">{isEditing ? '更新' : '追加'}</button>
        {isEditing && <button type="button" onClick={resetForm}>キャンセル</button>}
      </form>

      <ul>
        {accounts.map(account => (
          <li key={account.id}>
            {account.accountId}
            <button onClick={() => handleEdit(account)} style={{ marginLeft: '10px' }}>
              編集
            </button>
            <button onClick={() => handleDelete(account.id)} style={{ marginLeft: '5px' }}>
              削除
            </button>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default AccountManagement;
